#include <stdio.h>
#include <gmp.h>
int
main( int argc, char *argv[] )
{
	mpz_t m,c,d,n,e;
	mpz_init_set_str(m,"",10);	
	mpz_init_set_str(c,"0",10);	
	mpz_init_set_str(e,"65537",10);	
	mpz_init_set_str(d,"",10);	
	mpz_init_set_str(n,"",10);	

	mpz_powm_sec(c,m,e,n);
	gmp_printf("%Zd\n",c);
	mpz_powm_sec(m,c,d,n);
	gmp_printf("%Zd\n",m);
	return 0;
}
